import React,{Component} from 'react';

import { Input } from 'antd';
const Search = Input.Search;


export const ContextExample = React.createContext();

class imageSearchBar extends Component {
    constructor(props){
        super(props);
        this.state={
            name:"hello"
        }

    }

    handleSub(toSearch){
      //console.log(toSearch);

      this.props.callFun1(toSearch);
    }

    render(){
        return (

            <div>
                  <ContextExample.Provider value={this.state.name}>
                  <Search
      size="large" 
      placeholder="Search Images"
      onSearch={value => this.handleSub(value)}
      style={{ width: 400 }}
    />

                  </ContextExample.Provider>

             </div>
        );
    }

}

export default imageSearchBar;
